import React from "react";
import ResultsList from "./ResultsList";
//import { restaurantList } from "./src/screens/restaurantList";

const ResultsListContainer = ({ props }) => {
  return (
    <View>
      <ResultsList
        locationName={props[0].restaurantName}
        distance={restaurantList[0].distance}
        id={restaurantList[0].id}
      />
    </View>
  );
};

export default ResultsListContainer;
